end you notifications regarding new services offered by CrowdCoding and its partners that we think you may find valuable. CrowdCoding may also send you service-related announcements from time to time through the general operation of the Service. Generally, you may opt out of such emails, although CrowdCoding reserves the right to send you notices about your account even if you opt out of all voluntary email notifications.<p> Profile information is used by CrowdCoding primarily to be presented back to and edited by you when you access the Service and to be presented to other visitors. In some cases, other visitors may be able to supplement your profile, including by submitting comments.<p> CrowdCoding may use aggregate or anonymous data collected through the Service, including Activity Data, for any purpose. This data may be used by CrowdCoding and shared with third parties in any manner.<p> 4. Sharing Your Personally-Identifiable Information with Third Parties<p> CrowdCoding shares your personally-identifiable information only in limited circumstances where CrowdCoding believes such sharing is reasonably necessary to offer the Service, legally required or, permitted by you. For example:<p> We may provide personally-identifiable information to service providers who help us bring you the Service, such as hosting the Service at a co-location facility or sending email updates. In connection with these operations, our service providers may have access to personally-identifiable information for use for a limited time. Where we utilize service providers for the processing of any of personally-identifiable information, we implement reasonable contractual protections limiting the use of that personally- identifiable information to the provision of services to CrowdCoding.<p> We may be required to disclose personally-identifiable information pursuant to lawful requests, such as subpoenas or court orders, or in compliance with applicable laws. Additionally, we may share account or other personally-identifiable information when we believe it is necessary to comply with law, to protect our interests or property, to prevent fraud or other illegal activity perpetrated through the Service or using the CrowdCoding name, or to prevent imminent harm. This may include sharing personally-identifiable information with other companies, lawyers, agents or government agencies.<p> If the ownership of all or substantially all assets owned by CrowdCoding that are related to the Service were to change, your personally-identifiable information may be transferred to the new owner. In any such transfer of information, your personally- identifiable information would remain subject to this section.<p> 5. Links<p> The Service may contain links to other websites. We are of not responsible for the privacy practices of other websites. We encourage users to be aware when they leave the Service to read the privacy statements of other websites that collect personally identifiable information. This Privacy Policy applies solely to information collected byCrowdCoding via the Service.<p><br><br><br>',Eib="<b>This is the unit test phase. Using the test case given by another user, write a JsUnit test. Try to write as much as possible, don't worry about processing cycles or storage limits!",Iib='<b>This is the user story phase. Have a program you would like to create in mind, and write the specifications here. Please be as descriptive and thorough as possible, as this is all the informationall the other users will have to create the program.',b7='<br>',e7='<code>',Ecb='<div style="width: 100%; height: 100%; position: relative;"><div style="top: 0px; bottom: 0px; left: 0px; right: 0px;" id="',$bb='<gwt:clipper style="',Z8='<html><body onload="if(parent.__gwt_onHistoryLoad)parent.__gwt_onHistoryLoad(__gwt_historyToken.innerText)"><div id="__gwt_historyToken">',fcb="<img onload='this.__gwtLastUnhandledEvent=\"load\";' src='",c7="<span style='color:",$7='=',$6='>',G4='?',s4='@
